export default function DataTable() {
    const tableHeaderData = [
        { label: 'ID', key: 'id' },
        { label: 'Name', key: 'name' },
        { label: 'Age', key: 'age' },
        { label: 'Occupation', key: 'occupation' },
      ]
    return (
        <div>
            <h1>Data Table</h1>
            <table>
                <thead>
                    <tr>
                        {tableHeaderData.map((header)=> <th>{header.label}</th>)}
                    </tr>
                </thead>
            </table>
        </div>
    );
}
